  if (arg[5]) {
    casadi_copy(arg[5], 496, d.lbz);
  } else {
    casadi_fill(d.lbz, 496, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 748, d.lbz+496);
  } else {
    casadi_fill(d.lbz+496, 748, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 496, d.ubz);
  } else {
    casadi_fill(d.ubz, 496, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 748, d.ubz+496);
  } else {
    casadi_fill(d.ubz+496, 748, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 496, d.z);
  } else {
    casadi_clear(d.z, 496);
  }
  casadi_fill(d.z+496, 748, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 496, d.lam);
  } else {
    casadi_clear(d.lam, 496);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 748, d.lam+496);
  } else {
    casadi_clear(d.lam+496, 748);
  }
  /* Solve QP */
  if (casadi_qp_reset(&d)) return 1;
  while (1) {
    flag = casadi_qp_prepare(&d);
    if (flag || casadi_qp_iterate(&d)) break;
  }
